const defaultState = {
    count: 210
}

export const countReducer = (state = defaultState, action) => {
    switch (action.type) {
      case "ADD_1":
        return {...state, count: state.count + action.payload};
      case "SET_COUNT":
        return {...state, count: 0 + action.payload};
      default:
        return state;
    }
  }
